package aula01;

public class Operadores {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int valor1 = 10, valor2 = 5;
		
		int resultado = valor1 + valor2;
		System.out.println(resultado);
		
		resultado = valor1 - valor2;
		System.out.println(resultado);
		
		resultado = valor1 * valor2;
		System.out.println(resultado);
		
		
		resultado = valor1 - valor2;
		System.out.println(resultado);
		
		
	}

}
